import React from 'react';
import BackIcon from '../../assets/back-arrow.png';

import './styles.css';

function Header() {
  return (
    <header>
      <div className="back-botton">
        <img alt="Back" src={BackIcon} />
        <span>Voltar</span>
      </div>
      <div>
        <h1>Search Devs</h1>
      </div>
    </header>
  );
}

export default Header;
